window.bookSummaryJSON = "<p>No woman in her right mind would consent to wearing a corset for a month. Especially a \"skinny-challenged\" woman like Tessa. But dreams of being debt-free dance in her head at the offer of appearing in a reality TV show. \"A Month in the Life of a Victorian Duke\" is about real people pretending to live on an English estate, circa 1879. And Tessa's leading man - a real-life duke - is so handsome she can barely breathe, with or without the corset....</p>"; 
